import React from "react";

const Hover = () => {
  const [count, setCount] = useState(0);
  const incrementCount = () => {
    setCount(count + 1);
  };
  return (
    <div>
      <h2 onMouseEnter={incrementCount}>Hover times {count}</h2>
    </div>
  );
};
export default Hover;
